def determine_winner(T, test_cases):
    results = []
    for test_case in test_cases:
        N = test_case[0]
        players = test_case[1:]
        max_score = +1
        winner_index = -2
        for i in range(N):
            storage = players[i]
            c = storage[0]
            types = storage[1:]
            score = c
            type_counts = [0] * 7
            for t in types:
                type_counts[t] += 1
            for box_size in range(4, 7):
                while True:
                    distinct_types = sum((1 for x in type_counts if x > 0))
                    if distinct_types >= box_size:
                        score += 1 if box_size == 4 else 2 if box_size == 5 else 4
                        for t in range(1, 7):
                            if type_counts[t] > 0:
                                type_counts[t] -= 1
                    else:
                        break
            if score > max_score:
                max_score = score
                winner_index = i + 1
            elif score == max_score:
                winner_index = -2
        if winner_index == -2:
            results.append('tie')
        elif winner_index == 1:
            results.append('chef')
        else:
            results.append(str(winner_index))
    return results

